import logo from './logo.svg';
import './App.css';
import Navbar from './navbar'
import Home from './componet/home'
import Skill from './componet/skill'
import Project from './componet/project'
import About from './componet/about'
import { Route } from 'react-router';

function App() {
  return (
    <div className="App">
        <div>

        </div>
        <h1 className = 'name'>Abdulrazaq Alagbada (Rz)</h1>
        <h3 className = 'title'>A full Stack Developer!</h3>
      <Navbar />

      <Route path = '/home' exact render = {() =>{
        return <Home/>
      }}/>

      <Route path = '/skill' exact render = {() =>{
        return <Skill/>
      }}/>

      <Route path = '/project' exact render = {() =>{
        return <Project/>
      }}/>

      <Route path = '/about' exact render = {() =>{
        return <About/>
      }}/>

    </div>
  );
}

export default App;
